import React from 'react';
import all_products from '../'
import ProductCard from '../Components/ProductCard';

const Sneakers = () => {
    return (
        <div>
            {all_products.map(product => (
                <ProductCard key={product.id} product={product} />
            ))}
        </div>
    );
};

export default Sneakers;
